openapi: 3.0.3
info:
  title: Laravel
  description: ''
  version: 1.0.0
servers:
  -
    url: 'http://127.0.0.1'
paths:
  /api/v1:
    get:
      summary: ''
      description: ''
      parameters:
        -
          in: header
          name: Content-Type
          description: ''
          example: application/json
          schema:
            type: string
        -
          in: header
          name: Accept
          description: ''
          example: application/json
          schema:
            type: string
      responses:
        200:
          description: ''
          content:
            text/plain:
              schema:
                type: string
                example: "<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\">\n    <title>Document</title>\n    <link rel=\"stylesheet\" href=\"http://127.0.0.1/style.css\">\n</head>\n\n<body>\n    \n    <!-- JQUERY File -->\n    <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.2.1/jquery.min.js\"></script><!-- Stripe JS -->\n    <script src=\"https://js.stripe.com/v3/\"></script><!-- Your JS File -->\n    <script src=\"http://127.0.0.1/scripts.js\"></script>\n</body>\n\n</html>\n"
      tags:
        - Endpoints
      security: []
  /api/v1/token:
    get:
      summary: ''
      description: ''
      parameters:
        -
          in: header
          name: Content-Type
          description: ''
          example: application/json
          schema:
            type: string
        -
          in: header
          name: Accept
          description: ''
          example: application/json
          schema:
            type: string
      responses:
        200:
          description: ''
          content:
            text/plain:
              schema:
                type: string
                example: ''
      tags:
        - Endpoints
      security: []
  /api/v1/register:
    post:
      summary: 'register admin.'
      description: ''
      parameters:
        -
          in: header
          name: Content-Type
          description: ''
          example: application/json
          schema:
            type: string
        -
          in: header
          name: Accept
          description: ''
          example: application/json
          schema:
            type: string
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                name:
                  type: string
                  description: 'Must not be greater than 255 characters.'
                  example: tdgcfomgghhlmvoqoynkrlrmcdbkrdvlcgpxzlpldmqkfqjwdzraj
                email:
                  type: string
                  description: 'Must be a valid email address.'
                  example: lindsey.tremblay@example.com
                password:
                  type: string
                  description: 'Must be at least 8 characters.'
                  example: bcktolwx
              required:
                - name
                - email
                - password
      security: []
  /api/v1/login:
    post:
      summary: 'admin login.'
      description: ''
      parameters:
        -
          in: header
          name: Content-Type
          description: ''
          example: application/json
          schema:
            type: string
        -
          in: header
          name: Accept
          description: ''
          example: application/json
          schema:
            type: string
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                email:
                  type: string
                  description: 'Must be a valid email address. Must not be greater than 255 characters.'
                  example: ammepfultckgkegirbidismxycsoiavlgcyplqufgbaaxwlgzwqxfzzhiwfbuwbuhgbjhualjiafettxdjbalxlikvich
                password:
                  type: string
                  description: ''
                  example: et
              required:
                - email
                - password
      security: []
  /api/v1/password/request/reset:
    post:
      summary: ''
      description: ''
      parameters:
        -
          in: header
          name: Content-Type
          description: ''
          example: application/json
          schema:
            type: string
        -
          in: header
          name: Accept
          description: ''
          example: application/json
          schema:
            type: string
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: false
        content:
          application/json:
            schema:
              type: object
              properties:
                email:
                  type: string
                  description: ''
                  example: {  }
      security: []
  '/api/v1/reset/{email}/{token}':
    get:
      summary: ''
      description: ''
      parameters:
        -
          in: header
          name: Content-Type
          description: ''
          example: application/json
          schema:
            type: string
        -
          in: header
          name: Accept
          description: ''
          example: application/json
          schema:
            type: string
      responses:
        403:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  message: fail
                  data: { email: ['The email field is required.'] }
                properties:
                  message: { type: string, example: fail }
                  data: { type: object, example: { email: ['The email field is required.'] } }
      tags:
        - Endpoints
      security: []
    parameters:
      -
        in: path
        name: email
        description: ''
        example: aut
        required: true
        schema:
          type: string
      -
        in: path
        name: token
        description: ''
        example: laudantium
        required: true
        schema:
          type: string
